import React from 'react';
import './comun.css';
import './tienda.css';

function Tienda(){
    return(
        <main id="main">
            <section className="destacado" id="destacados">
                <h2>Destacados</h2>
                <div id="divDestacado" class="media-q">
                </div>
            </section>
            <section className="PC-Escritorio" id="PC-Escritorio">
                <h2>PC Escritorio</h2>
                <div id="divEscritorio" class="media-q">

                </div>
            </section>
            <section className="Notebooks" id="Notebooks">
                <h2>Notebooks</h2>
                <div id="divNotebook" class="media-q">

                </div>
            </section>
            <section className="Consolas" id="Consolas">
                <h2>Consolas</h2>
                <div id="divConsolas" class="media-q">

                </div>
            </section>
        </main>
    );
}

export default Tienda;
